import './App.scss';
import React from 'react';

const ArtworkTile = props => {
  const { url, title } = props

  const tileStyle = { backgroundImage: `url(${props.url})`}

  return (
    <div className="tile" style = {tileStyle}>
        {title}
    </div>
  )
}

export default ArtworkTile
